America Unearthed is an American television series that was the first original series to air on the A&amp;E Networks channel H2. The show premiered on 21 December 2012 and is produced by Committee Films of Chaska, Minnesota.


Plot:
----------
The program is hosted by a Minnesota based geologist named Scott Wolter, who is described as an &quot;Indiana Jones adventurer.&quot; Wolter investigates mysteries and artifacts that he believes ostensibly reveal an alternative history of the United States.





